import React from "react";
import { TextField, Grid, Paper,Avatar, Button } from "@mui/material";
import LockIcon from '@mui/icons-material/Lock';

export function Login() {
const paperStyle = {padding :20,height :"70vh" ,align :"center", width :280 , margin :"20px auto" ,}
const avatarStyle = {backgroundColor :"#1bbd7e"}
  return (
    <div>
      <h1>login page</h1>
      <div>
        <Grid>
          <Paper elevation ={10} style={paperStyle}>
            <Grid align ="center">
              <Avatar style={avatarStyle}><LockIcon/></Avatar>
            </Grid>
            <br/>
              <TextField variant="standard" label="Username" /><br/><br/>
              <TextField variant="outlined" label="Email" type="email" /><br/><br/>
              <TextField variant="filled" label="Password" type="password" />
             <Button type= ""></Button>
          </Paper>
        </Grid>
      </div>
    </div>
  );
}
